var wAccordionMovies = angular.module("wAccordionMovies",[]);

wAccordionMovies.controller( "wAccordionMoviesController", function( $scope ) {
	var dq = new DataQuery( 'qUsBoxOfficeNew' );
	dq.execute().
	done( function() {
		$scope.$apply(function() {
			$scope.results = dq.getData();
		});
	});

});
